For this is the Book of the Dead, the Book of the Black Earth, that I have writ .... 
that of the arms of two men, and as it rose from the earth it was followed by 
another, ... a pool of slime, like green oil, and the smell of a body lain long in the 
sun to rot. ..... bloweth and make upon ye stone ye mark of ye Lion-serpent thus:{
Leo Sigil}
